"use strict";app.component("eeaHeader",{template:'<style>\n	.top-bar {\n	    position: fixed;\n	    display: block;\n	    margin: 0;\n	    padding: 0;\n	    width: 100%;\n	    top: 0;\n	    z-index: 9999;\n	    box-shadow: 1px 1px 1px rgba(10, 10, 10, 0.3);\n	    will-change: all;\n	    transition: all 0.3s ease-out;\n	}\n	.top-bar,\n	.top-bar ul {\n	    background-color: #E6E6E6;\n	}\n	.top-bar,\n	.top-bar a {\n	    color: #fff;\n	    font-size: 14px;\n	}\n	#tool-ribbon {\n	    background-color: #ffffff;\n	    border-bottom: 4px solid #6f7072;\n	    color: #315076;\n	    font-size: 80%;\n	    height: 30px;\n	    width: 100%;\n	}\n	#left-tools {\n	    float: left;\n	    height: 20px;\n	    padding: 4px 0.5em;\n	    text-align: left;\n	    vertical-align: middle;\n	}\n	a#eealink {\n	    background: url("http://www.eionet.europa.eu/styles/eionet2007/eeaicon.gif") no-repeat scroll left center rgba(0, 0, 0, 0);\n	    padding-left: 18px;\n	}\n	#right-tools {\n	    float: right;\n	    text-align: right;\n	    width: 60%;\n	    font-size: 0.75rem;\n	}\n	a#printlink {\n	    background: url("http://www.eionet.europa.eu/styles/eionet2007/print_icon.gif") no-repeat scroll left center rgba(0, 0, 0, 0);\n	    padding: 3px 0.5em 1px 16px;\n	    display: inline-block;\n	    margin-left: 1.25rem;\n	}\n	#page-head {\n	    border-top: 1px solid #4b5257;\n	    clear: both;\n	}\n	.tplarge {\n	    height: 132px;\n	}\n	.tpsmall {\n	    height: 80px;\n	}\n	.tplarge #network-title {\n	    font-size: 200%;\n	    padding-top: 20px;\n	}\n	.tpsmall #network-title {\n	    font-size: 100%;\n	    padding-top: 2px;\n	}\n	.tplarge #site-title {\n	    font-size: 120%;\n	}\n	.tpsmall #site-title {\n	    font-size: 100%;\n	}\n	.tplarge #page-head a {\n	    font-size: 120%;\n	    height: 101px;\n	}\n	.tpsmall #page-head a {\n	    font-size: 100%;\n	    height: 48px;\n	}\n	#page-head a {\n	    background: url("http://www.eionet.europa.eu/styles/eionet2007/top_graphic.gif") no-repeat scroll left center transparent;\n	    position: absolute;\n	    right: 40px;\n	    top: 31px;\n	    width: 323px;\n	    will-change: all;\n	    transition: all 0.3s ease-out;\n	}\n	#formworkarea {\n	    float: none;\n	    margin: 0 auto;\n	}\n	#network-title {\n	    color: #00446A;\n	    font-size: 200%;\n	    font-variant: small-caps;\n	    font-weight: bold;\n	    padding-left: 25px;\n	    padding-top: 20px;\n	    will-change: all;\n	    transition: all 0.3s ease-out;\n	}\n	#site-title {\n	    color: #006699;\n	    font-size: 120%;\n	    font-weight: bold;\n	    padding-left: 25px;\n	    will-change: all;\n	    transition: all 0.3s ease-out;\n	}\n	</style>\n	<div id="head" class="top-bar sticky tplarge">\n	<div id="tool-ribbon">\n		<div id="left-tools">\n			<a id="eealink" href="http://www.eea.europa.eu/">EEA</a>\n		</div>\n		<div id="right-tools">\n				<a href="http://www.eea.europa.eu/">\n					<b>European Environment Agency</b>\n				</a>\n				Kgs. Nytorv 6, DK-1050 Copenhagen K, Denmark - Phone: +45 3336 7100              \n			<a id="printlink" href="javascript:this.print();" title="Print this page">\n				<span>Print</span>\n			</a>\n		</div>\n	</div>\n	<div id="page-head">\n		<a accesskey="1" href="/">\n		</a>\n		<div id="network-title">Eionet</div>\n		<div id="site-title">European Environment Information and Observation Network</div>\n	</div>\n</div>',controller:function(n,t){this.$onInit=function(){$(document).on("scroll",function(){$(document).scrollTop()>40?$("#head").removeClass("tplarge").addClass("tpsmall"):$("#head").removeClass("tpsmall").addClass("tplarge")})}}});